body.div:
			τέκνον, ἐν πρᾳΰτητί σου
δόξασον τὴν ψυχήν σου, καὶ δὸς αὐτῇ τιμὴν κατὰ τὴν ἀξίαν
 αὐτῆς. τὸν ἁμαρτάνοντα εἰς τὴν ψυχὴν αὐτοῦ τίς δικαιώσει;

			ἄνθρωπος παραβαίνων ἀπὸ τῆς κλίνης αὐτοῦ, λέγων ἐν τῇ ψυχῇ
αὐτοῦ· τίς με ὁρᾷ ; σκότος κύκλῳ μου, καὶ οἱ τοῖχοί με καλύπτουσι,
καὶ οὐθείς με ὁρᾷ, τί εὐλαβοῦμαι;

			καὶ οὕτως ἐρεῖτε ἐν ἐξομολογήσει· τὰ ἔργα Κυρίου πάντα
καλὰ σφόδρα, καὶ πᾶν πρόσταγμα ἐν καιρῷ αὐτοῦ
 ἔσται· οὐκ ἔστιν εἰπεῖν· τί τοῦτό ἐστι;
